var Login_view = Backbone.View.extend({
    el: 'body',
    defaults: {
        content_usuarios: "#content_usuarios"
    }
    ,events: {        
        "click .btn_consulta_usuarios": "f_consultarUsuarios"
    },
    initialize: function(e){
        try {
            var _this = this;
        }catch(exception){
            console.log(exception);
        }
    },
    f_consultarUsuarios: function(e){
        var _this = this;
        
        var la_dataCollection = {};
        la_dataCollection =  {
        }

        _this.model.f_consultarUsuariosModel(la_dataCollection).done(function (response){
            if(response.return < 0){
                swal.fire("¡Atención!", "Ocurrió un error inesperado, favor de contactar a sistemas.", "error");
                return -1;
            }
            
            $(_this.defaults.content_usuarios).html(response.contenido);
        });
    },
    f_validarEnter: function(e){
        li_tecla = e.keyCode || e.which;  
        return (li_tecla == 13);
    }  
});

$(document).ready(function () {
    Login_view = new Login_view({model: new Login_model()});
});